import React, { useEffect, useState } from 'react';
import axios from 'axios';

const Reports = () => {
  const [summary, setSummary] = useState(null);
  const [delayed, setDelayed] = useState([]);
  const [viewDelayed, setViewDelayed] = useState(false);

  useEffect(() => {
    axios.get('/api/dashboard/summary')
      .then(res => setSummary(res.data));
  }, []);

  const handleDelayedClick = () => {
    axios.get('/api/requests/delayed')
      .then(res => setDelayed(res.data));
    setViewDelayed(true);
  };

  return (
    <div>
      <h2>Reports Page</h2>
      {summary && (
        <div>
          <p>Total: {summary.total}</p>
          <p>Completed: {summary.completed}</p>
          <p>Pending: {summary.pending}</p>
          <p>Delayed: {summary.delayed}</p>
        </div>
      )}
      <button onClick={handleDelayedClick}>View Delayed Requests</button>

      {viewDelayed && (
        <table>
          <thead>
            <tr>
              <th>ID</th><th>User ID</th><th>Description</th><th>Status</th><th>Expected Date</th>
            </tr>
          </thead>
          <tbody>
            {delayed.map(req => (
              <tr key={req.requestId}>
                <td>{req.requestId}</td>
                <td>{req.userId}</td>
                <td>{req.description}</td>
                <td>{req.status}</td>
                <td>{req.exceptCompletionDate}</td>
              </tr>
            ))}
          </tbody>
        </table>
      )}
    </div>
  );
};

export default SuperAdminReports;
